import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Importando as páginas da pasta 'pages'
import Home from './Pages/Home.js';
import Cadastro from './Pages/Cadastro.js';
// import Detalhes from './pages/Detalhes'; // Deixe comentado até criarmos essa página

// Importando o CSS Module do App
import styles from './App.css';

function App() {
  return (
    <Router>
      {/* Menu de Navegação usando classes do CSS Module */}
      <nav className={styles.nav}>
        <Link to="/" className={styles.link}>Home</Link>
        <Link to="/cadastro" className={styles.link}>Novo Personagem</Link>
      </nav>

      <Routes>
        {/* Definição das Rotas */}
        <Route path="/" element={<Home />} />
        <Route path="/cadastro" element={<Cadastro />} />
        {/* <Route path="/detalhes/:id" element={<Detalhes />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
